import React from 'react';
import styled from 'styled-components';

const Card = styled.div`
  float: left;
  margin-left: 25px;
`;

const MoviePoster = ({ i }) => {
  return (
    <>
      <Card>
        <img
          src={'/img/poster' + (i + 1) + '.jpg'}
          width="150px"
          height="200px"
        />
      </Card>
    </>
  );
};

export default MoviePoster;
